import React from "react";
import image1 from "./images/novice";
import image2 from "./images/University";
import image3 from "./images/gamer";

const cards = [

    {
        id: 1,
        title: Novice,
        image: image1
    },

    {
        id: 2,
        title: University,
        image: image2
    },

    {
        id: 3,
        title: gamer,
        image: image3
    }

]

export default cards;
